import React from 'react';

const Category = () => {
  return (
    <nav className="navbar navbar-expand-md sticky-top py-3 navbar-dark" id="mainNav">
      <div className="container">
        {/* Toggle button is always visible */}

        
        {/* Navbar items with "show" class to make them always visible */}
          <ul className="navbar-nav ">

            {/* Dropdown menu for categories */}
            <li className="nav-item dropdown">
              <a 
                className="nav-link dropdown-toggle" 
                href="#" 
                id="navbarDropdown" 
                role="button" 
                data-bs-toggle="dropdown" 
                aria-expanded="false"
              >
                Categories
              </a>
              <ul className="dropdown-menu dropdown-menu-end" aria-labelledby="navbarDropdown">
                <li><a className="dropdown-item" href="#">All</a></li>
                <li><a className="dropdown-item" href="#">Food</a></li>
                <li><a className="dropdown-item" href="#">Drink</a></li>
              </ul>
            </li>
          </ul>
      </div>
    </nav>
  );
};

export default Category;
